import axios from "axios";
import { userLoginAction } from "../actions/userAction";



export const LoginUserpost = async (mydata) => {
  const config = {
    headers: { "Content-Type": "application/json" },
  };
  const req = await axios.post("/api/v1/login", mydata, config);
  const data = await JSON.stringify(req.data.user) 

};
